  const [value, setValue] = useState('');



  const handleSubmit = (e) => {
    e.preventDefault();
    let data = document.getElementsByName("file")[0].files["0"];

    const { name,size,path,lastModifiedDate} = data;
    if(name && size && path && lastModifiedDate ){
      setImage([
        ...show,
        {
          name: data.name,
          size: data.size,
          path: data.path,
          lastModifiedDate: data.lastModifiedDate,
        },
      ]);
    }
    console.log('angy',data.lastModifiedDate);
  }








  return (
    < div className="App">


      <center>
        <form onSubmit={(e)=> handleSubmit(e)}>
        <input type="file" name="file" placeholder="choose the file" />
        <button >upload File</button>
      </form>
        <br /><br /><br /><br />
        <div>

              <h2>Name : {data.name}</h2>
              <h2>Size : {image.size}</h2>
              <h2>Path : {image.path}</h2>
              <h2>Time : {image.time}</h2>
            </div>

            <div></div>



          </center>

    </div>
  );
}

export default App;
